function b64decode(s) { const b = atob(s); const arr = new Uint8Array(b.length); for (let i = 0; i < b.length; i++) arr[i] = b.charCodeAt(i); return arr; }
async function unlock(e) {
  e.preventDefault();
  const pw = document.getElementById("pw").value;
  document.getElementById("btn").style.display = "none";
  document.getElementById("spinner").style.display = "block";
  document.getElementById("error").style.display = "none";
  try {
    const salt = b64decode(SALT), iv = b64decode(IV), encrypted = b64decode(DATA);
    const keyMaterial = await crypto.subtle.importKey("raw", new TextEncoder().encode(pw), "PBKDF2", false, ["deriveKey"]);
    const key = await crypto.subtle.deriveKey({ name: "PBKDF2", salt, iterations: 100000, hash: "SHA-256" }, keyMaterial, { name: "AES-GCM", length: 256 }, false, ["decrypt"]);
    const decrypted = await crypto.subtle.decrypt({ name: "AES-GCM", iv }, key, encrypted);
    document.open(); document.write(new TextDecoder().decode(decrypted)); document.close();
  } catch (err) {
    document.getElementById("btn").style.display = "block";
    document.getElementById("spinner").style.display = "none";
    document.getElementById("error").style.display = "block";
    document.getElementById("pw").value = "";
    document.getElementById("pw").focus();
  }
  return false;
}
